                $('.step-container').scrollspy({target: '.reportNavigation'});

                var $pdfContent = '<a id="exportPDF" class="pdf_download exportPDF pa"><span class="add-on"><img class="pdf_img" src="/static/images/pdf_download.png"　alt="PDF" /></span><span class="pdf_text" i18n="observer.reportScreen.PDF_DOWNLOAD"></span></a>';
                $(".reportNavigation").prepend($pdfContent);
